                "job_status_message": "Активная вакансия",
                "job_description": "Основные задачи:\n- Исследование и анализ актуальных, популярных и модных тенденций, анализ трендов на предстоящий сезон;\n- Анализ Fashion и социальных тенденций на мировом и российском рынке, прогнозирование коммерческого спроса;\n- Анализ коллекций ТМ конкурентов и ТМ аналогов;\n- Поиск идей для коллекции разрабатываемого ассортимента;\n- Анализ продаж разрабатываемого ассортимента с точки зрения дизайна;\n- Разработка дизайн-концепции коллекции на основе философии и стиля бренда (работа с референсами, составление мудбордов для будущей коллекции, подбор цветовой палитры и фурнитуры, составление цветовых бордов коллекции);\n- Внесение свежих идей в рамках концепции бренда;\n- Разработка ассортиментной матрицы;\n- Разработка и создание художественных эскизов коллекции и капсул в соответствии с ассортиментной матрицей;\n- Объединение изделий в коллекцию;\n- Прорисовка технических эскизов моделей одежды и деталей для запуска в производство;\n- Подбор материалов (тканей, фурнитуры), создание и ведение библиотеки материалов;\n- Работа с базой тканей, базой фурнитуры, участие в подборе наилучших вариантов для коллекции;\n- Авторский контроль модели от эскиза до образца-эталона;\n- Разработка технической документации;\n- Подготовка дизайнерской документации для производства в заданном формате;\n- Взаимодействие с технологом и конструктором и руководителем экспериментального цеха.  \n\nЧто нам важно:\n- Имеете опыт работы на аналогичной позиции;\n- Наличие портфолио и мудбордов;\n- Знание и понимание современных тенденций и трендов (текущих и предстоящих);\n- Творческие способности, художественный вкус;\n- Понимание целевой аудитории;\n- Владение Adobe Photoshop, Adobe Illustrator, CorelDraw, Excel;\n- Умение работать с любыми источниками;\n- Высшее/среднее специальное образование в области дизайна одежды приветствуется;\n- Навык конструирования будет вашим преимуществом;\n- Имеете высокий уровень ответственности, серьезный подход к делу и к жизни;\n- Умеете анализировать результаты своей работы и постоянно стремитесь к их улучшениям;\n- Наличие своего видения и готовности привносить свежие идеи в концепцию бренда;\n- Умение планировать рабочее время и грамотно организовать свой день;\n- Стрессоустойчивость, коммуникабельность, желание работать и развиваться;\n- Нам интересны перспективные кандидаты, люди с активной жизненной позицией.\n\nСсылка на портфолио в резюме обязательна:просим прислать 15-20 работ за последние 2 года: эскизы, мудборды, технические рисунки и т.д.\n\nГотовность выполнить тестовое задание при успешном прохождении собеседования.",
