                "job_description": "Обязанности:\n- плотная работа в организации и проведении съёмок в паре (и самостоятельно) с креативным директором и продакшн-группой;\n- работа по ведению, заполнению и актуализации материала на сайте бренда (выстраивание карточек товара и написание текстов);\n- участие в рабочих встречах и самостоятельное их проведение;\n- участие в работе над продуктом (курирование этапа создания сэмпла изделия к съёмке и т.п.);\n- работа с телеграм-каналом бренда;\n- выполнение разнохарактерных работ внутри проектной деятельности бренда;\n- интеграция в самые глубокие и интересные процессы в бренде;\n- делать и создавать так, как это можно только в ZNWR.\n\nТребования:\n- вовлеченность;\n- коммуникабельность;\n- чувство композиции и цвета;\n- способность понимать, интерпретировать и выражать чувства, возникающие в связи с объектом работы — проявление эстетического интеллекта;\n- четко и быстро вербализировать смыслы;\n- готовность работать много и плотно в паре с креативным директором;\n- гибкий интеллект.\n\nУсловия:\n- Многопрофильное развитие внутри бренда. Работа в паре с креативным директором ZNWR, обучение в рамках бренда. Создание артовых продуктов в Fashion сфере. Нахождение в среде людей искренне любящих дизайн;\n- ЗП по итогам собеседования, офис на Красных Воротах с большими окнами, перманентная скидка на изделия бренда 50% [+возможность иногда работать удаленно];\n- Много интересной и разной работы. Возможность работать в компетентной команде, реализовывать самые смелые идеи, экспериментировать и создавать уникальные вещи. Перспектива роста. Гордость за результат.",
